import { useState } from "react";

const Example = () => {
  const [ischecked, checkToggle] = useState(!true);
  const toggle = () => !ischecked;
  return (
    <>
      <input type="checkbox" checked={ischecked} onchange={(e) => toggle(e)} />
    </>
  );
};

export default Example;
